import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('Sunset-DemiBold Regular-normal.ttf', font);
this.addFont('Sunset-DemiBold Regular-normal.ttf', 'Sunset-DemiBold Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
export default callAddFont;
